import React from 'react';
import { NavLink } from 'react-router-dom';
import NavBar from './NavBar';

export default function About() {
    return (
        <header className="about">
            <NavBar></NavBar>
            <div>
               <h3>About</h3>
               <p>Info about the page</p> 
            </div>
        </header>
    )
}
